import React, { Component } from "react";
import { Link } from "react-router-dom";

function Products(props) {
  return (
    <section>
      <img src="props.img" />
      <b>Name:</b> {props.name} <br />
      <b>Price:</b> {props.price}
    </section>
  );
}

export default Products;
